import { getproduct } from '../Services/api';

export default function Productview() {
    const[productdata,setproductdata]=useState([]);
    useEffect(()=>{
       getproductdetails();
    } ,[]);

    const getproductdetails= async()=>{
      const result= await getproduct();
      setproductdata(result);
      console.log(result);
    }
  return (
  <>
